INSERT INTO `article` VALUES (1,'Wifi, Bluetooth, infrared','<p><strong style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">Wi-Fi</strong><span style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">&nbsp;adalah sebuah teknologi terkenal yang memanfaatkan peralatan elektronik untuk bertukar data&nbsp;</span><a style=\"color: #298404; text-decoration: initial; font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\" title=\"Jaringan nirkabel\" href=\"http://id.wikipedia.org/wiki/Jaringan_nirkabel\">secara nirkabel</a><span style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">&nbsp;(menggunakan&nbsp;</span><a style=\"color: #298404; text-decoration: initial; font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\" title=\"Gelombang radio\" href=\"http://id.wikipedia.org/wiki/Gelombang_radio\">gelombang radio</a><span style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">) melalui sebuah&nbsp;</span><a style=\"color: #298404; text-decoration: initial; font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\" title=\"Jaringan komputer\" href=\"http://id.wikipedia.org/wiki/Jaringan_komputer\">jaringan komputer</a><span style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">, termasuk koneksi&nbsp;</span><a style=\"color: #298404; text-decoration: initial; font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\" title=\"Internet berkecepatan tinggi (halaman belum tersedia)\" href=\"http://id.wikipedia.org/w/index.php?title=Internet_berkecepatan_tinggi&amp;action=edit&amp;redlink=1\">Internet berkecepatan tinggi</a><span style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">.&nbsp;</span><a style=\"color: #298404; text-decoration: initial; font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\" title=\"Wi-Fi Alliance (halaman belum tersedia)\" href=\"http://id.wikipedia.org/w/index.php?title=Wi-Fi_Alliance&amp;action=edit&amp;redlink=1\">Wi-Fi Alliance</a><span style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">&nbsp;mendefinisikan Wi-Fi sebagai &ldquo;produk&nbsp;</span><a style=\"color: #298404; text-decoration: initial; font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\" title=\"LAN Nirkabel (halaman belum tersedia)\" href=\"http://id.wikipedia.org/w/index.php?title=LAN_Nirkabel&amp;action=edit&amp;redlink=1\">jaringan wilayah lokal nirkabel</a><span style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">&nbsp;(WLAN) apapun yang didasarkan pada standar&nbsp;</span><a style=\"color: #298404; text-decoration: initial; font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\" title=\"Institute of Electrical and Electronics Engineers\" href=\"http://id.wikipedia.org/wiki/Institute_of_Electrical_and_Electronics_Engineers\">Institute of Electrical and Electronics Engineers</a><span style=\"font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\">&nbsp;(IEEE) 802.11&Prime;.&nbsp;Meski begitu, karena kebanyakan WLAN zaman sekarang didasarkan pada standar tersebut, istilah &ldquo;Wi-Fi&rdquo; dipakai dalam bahasa Inggris umum sebagai sinonim &ldquo;WLAN&rdquo;.</span><a style=\"color: #298404; text-decoration: initial; font-family: Arial, Tahoma, Verdana; font-size: 11px; line-height: 13px; text-align: justify;\" href=\"http://ilmukomputer.org/wp-content/uploads/2013/02/Wifi-Bluetooth-infrared.doc\">Wifi, Bluetooth, infrared</a></p>','','egisolehhasdi','2013-02-10 18:56:00',NULL,NULL,NULL,NULL,5,NULL,'publish'),(2,'Magic Methods','<p style=\"outline: none; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: justify; line-height: 22px; color: #666666; font-family: SheepSansRegular, arial, helvetica;\"><span style=\"color: #666666; font-family: SheepSansRegular, arial, helvetica;\"><span style=\"line-height: 22px;\">Proin nonummy, lacus eget pulvinar lacinia, pede felis dignissim leo, vitae tristique magna lacus sit amet eros. Nullam ornare. Praesent odio ligula, dapibus sed, tincidunt eget, dictum ac, nibh. Nam quis lacus. Nunc eleifend molestie velit. Morbi lobortis quam eu velit. Donec euismod vestibulum massa. Donec non lectus. Aliquam commodo lacus sit amet nulla. Cras dignissim elit et augue. Nullam non diam. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. In hac habitasse platea dictumst. Aenean vestibulum. Sed lobortis elit quis lectus. Nunc sed lacus at augue bibendum dapibus.</span></span></p>\r\n<p style=\"outline: none; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: justify; line-height: 22px; color: #666666; font-family: SheepSansRegular, arial, helvetica;\"><span style=\"color: #666666; font-family: SheepSansRegular, arial, helvetica;\"><span style=\"line-height: 22px;\">&nbsp;&nbsp;<img src=\"../../../../file-manager/upload/image/batik-lebih-dari-sekadar-warisan-budaya-indonesia.jpg\" alt=\"\" width=\"328\" height=\"219\" /></span></span></p>','PHP','egisolehhasdi','2013-02-10 19:03:44','egisolehhasdi','2013-02-10 21:19:25',NULL,NULL,6,NULL,'archived'),(3,'Menampilkan data produk dalam bentuk grid dengan php dan mysql','<p><img class=\"thumb full\" style=\"outline: none; margin: 5px auto 10px; padding: 3px; border: 2px solid #f4f4f4; font: inherit; vertical-align: baseline; width: 651.6875px; background-image: none; background-attachment: scroll; display: block; color: #666666; font-family: SheepSansRegular, arial, helvetica; line-height: 14px; background-position: 0px 0px; background-repeat: repeat repeat;\" title=\"Menampilkan data produk dalam bentuk grid dengan php dan mysql\" src=\"http://jagocoding.com/uploads/userdata/fuadindra30/ScreenHunter_03Oct.0520.420.jpg\" alt=\"Menampilkan data produk dalam bentuk grid dengan php dan mysql\" /></p>\r\n<div id=\"article-content\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #666666; font-family: SheepSansRegular, arial, helvetica; line-height: 14px;\">\r\n<p style=\"outline: none; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: justify; line-height: 22px;\">Pernah liat tampilan produk pada website e-commerce misalnya&nbsp;<a style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #1e488e;\" href=\"http://www.tokokaos.com/catalog.php\">http://www.tokokaos.com/catalog.php</a>&nbsp;atau pada koleksi album foto di facebook kamu. Nah tampilan yang biasanya terdiri dari beberapa baris data yang tersusun secara konstan misal tiap baris ada 4 data disebut dengan tampilan dalam bentuk grid.</p>\r\n<p style=\"outline: none; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: justify; line-height: 22px;\">Tampilan seperti ini sering kita jumpai dalam website e-commerce. Fungsinya jelas untuk menampilkan katalog produk dalam bentuk foto produk yang tersusun rapi biasanya terdiri dri 3 atau 4 produk per barisnya. Dengan tampilan grid, akan mempermudah pengunjung website dalam melihat-lihat koleksi produk yang ditawarkan.</p>\r\n<p style=\"outline: none; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: justify; line-height: 22px;\">Ok langsung saja kita praktekkan..</p>\r\n<p style=\"outli