trong>.</p>\r\n<h3 style=\"margin:0px 0px 20px;padding:0px;border:0px;font-size:18px;font:inherit;vertical-align:baseline;color:#49ac80;font-family:SheepSansRegular, arial, helvetica;\">Sisi Client</h3>\r\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:justify;line-height:22px;color:#666666;font-family:SheepSansRegular, arial, helvetica;\">AJAX secara default tidak dapat mengirimkan variable $_FILES melaluiÂ <span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\">HTTP Request, oleh karena itu kita akan menggunakan library jQuery bernamaÂ <a style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;color:#49ac80;\" href=\"http://www.phpletter.com/Demo/AjaxFileUpload-Demo/\">AJAX File Upload Plugin</a><span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\">. Library ini akan mensimulasikan Ajax melalui iFrame, sehingga pengiriman variable $_FILES dapat dilakukan.Â <span style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;\">Prinsip yang dipakai sangat sederhana, yaitu pertama kita panggil kode pada server yang berfungsi untuk menangani proses upload menggunakan teknik AJAX. Selama proses upload tersebut berlangsung kita tampilkan indikator atau pesan tertentu kepada user.Â </span></span></span>Server akan memberikan tanggapan berupa dokumen JSON yang berisi status berhasil atau tidaknya proses upload tersebut. Jika berhasil, server akan mengirimkan informasi tentang file yang telah di-upload tersebut dan selanjutnya kita tampilkan hasilnya, apakah file berhasil diupload atau tidak.</p>\r\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:justify;line-height:22px;color:#666666;font-family:SheepSansRegular, arial, helvetica;\">Buatlah sebuah file html, misalnyaÂ <strong style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;color:#49ac80;\">index.html</strong>Â di dalam sebuah folder, kemudian jangan lupa masukkan di dalam folder tersebut file jquery beserta fileÂ <strong style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;color:#49ac80;\">ajaxfileupload.js.</strong></p>\r\n<p style=\"margin:0px 0px 10px;padding:0px;border:0px;font:inherit;vertical-align:baseline;text-align:justify;line-height:22px;color:#666666;font-family:SheepSansRegular, arial, helvetica;\">Di dalam file index.html (file client) kita akan buat sebuah file input dan tombol submit, seperti berikut ini:</p>\r\n<div style=\"margin:0px;padding:0px;border:0px;font:inherit;vertical-align:baseline;color:#666666;font-family:SheepSansRegular, arial, helvetica;line-height:14px;\">\r\n<div class=\"syntaxhighlighter xml\" style=\"padding:10px 0px;border-width:1px 0px;border-top-style:solid;border-bottom-style:solid;border-top-color:#cccccc;border-bottom-color:#cccccc;font:inherit;vertical-align:baseline;width:665px;margin:1em 0px;font-size:1em;\">\r\n<table style=\"font:inherit;border-collapse:collapse;border-spacing:0px;width:852px;margin:0px;padding:0px;border:0px;font-size:1em;vertical-align:baseline;background-image:none;float:none;height:auto;line-height:1.1em;font-family:Consolas, \'Bitstream Vera Sans Mono\', \'Courier New\', Courier, monospace;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><tbody style=\"font:inherit;margin:0px;padding:0px;border:0px;font-size:1em;vertical-align:baseline;background-image:none;float:none;height:auto;line-height:1.1em;width:auto;\"><tr style=\"font:inherit;margin:0px;padding:0px;border:0px;font-size:1em;vertical-align:baseline;background-image:none;float:none;height:auto;line-height:1.1em;width:auto;\"><td class=\"gutter\" style=\"font:inherit;margin:0px;padding:0px;border:0px;font-size:1em;vertical-align:baseline;background-image:none;float:none;height:auto;line-height:1.1em;width:auto;font-family:Consolas, \'Bitstream Vera Sans Mono\', \'Courier New\', Courier, 