ke mana-mana baik aplikasi desktop/mobile maupun aplikasi berbasis web. Oleh karena itu, jika kita membuat sebuah aplikasi web kita harus memperhatikan target user, apakah user menggunakan perangkat mobile atau bukan, PC atau bukan. Dengan mengetahui target, kita dapat membuat layout dan kebutuhan fitur yang sesuai dengan perangkat tersebut. Misalnya saja Facebook, Facebook versi desktop dibuat full fitur, sedangkan Facebook versi mobile dibuat minim akan fitur. Atau contoh lain adalah detik.com, kompas.com, dan situs berita lainnya yang menggunakan versi mobile akan dibuat berbeda dengan versi aslinya (desktop). Faktanya, banyak web yang dibuat lebih simpel pada mobile dibandingkan desktop. Untuk itu, maka kita harus menambahkan kode untuk mengecek apakah browser yang user pakai itu perangkat mobile atau bukan.</p>\r\n<p style=\"outline: none; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: justify; line-height: 22px; color: #666666; font-family: SheepSansRegular, arial, helvetica;\">Ok kita langsung saja ke tutorial. ;)</p>\r\n<p style=\"outline: none; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: justify; line-height: 22px; color: #666666; font-family: SheepSansRegular, arial, helvetica;\">Function yang akan kita gunakan untuk deteksi metadata/information dari browser yang dipakai adalah function&nbsp;<strong style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #1e488e;\">get_browser()</strong>, lengkapnya adalah:</p>\r\n<p style=\"outline: none; margin: 0px 0px 10px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; text-align: justify; line-height: 22px; color: #666666; font-family: SheepSansRegular, arial, helvetica;\"><span class=\"type\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><a class=\"type mixed\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #1e488e;\" href=\"http://www.php.net/manual/en/language.pseudo-types.php#language.types.mixed\">mixed</a></span><span style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">&nbsp;</span><span class=\"methodname\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><strong style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline; color: #1e488e;\">get_browser</strong></span><span style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">&nbsp;([&nbsp;</span><span class=\"methodparam\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><span class=\"type\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">string</span>&nbsp;<code class=\"parameter\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">$user_agent</code></span><span style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">&nbsp;[,&nbsp;</span><span class=\"methodparam\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\"><span class=\"type\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">bool</span>&nbsp;<code class=\"parameter\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">$return_array</code><span class=\"initializer\" style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inherit; vertical-align: baseline;\">&nbsp;= false</span></span><span style=\"outline: none; margin: 0px; padding: 0px; border: 0px; font: inh