s ac tellus et risus vulputate vehicula. Donec lobortis risus a elit. Etiam tempor. Ut ullamcorper, ligula eu tempor congue, eros est euismod turpis, id tincidunt sapien risus a quam. Maecenas fermentum consequat mi. Donec fermentum. Pellentesque malesuada nulla a mi. Duis sapien sem, aliquet nec, commodo eget, consequat quis, neque. Aliquam faucibus, elit ut dictum aliquet, felis nisl adipiscing sapien, sed malesuada diam lacus eget erat. Cras mollis scelerisque nunc. Nullam arcu. Aliquam consequat. Curabitur augue lorem, dapibus quis, laoreet et, pretium ac, nisi. Aenean magna nisl, mollis quis, molestie eu, feugiat in, orci. In hac habitasse platea dictumst.</p>','','egisolehhasdi','2013-02-10 21:34:41','egisolehhasdi','2013-02-10 21:46:05',NULL,NULL,11,'egisolehhasdi','publish'),(9,'Ecma Script','<p><strong style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">ECMAScript</strong><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">Â is theÂ </span><a style=\"color:#0b0080;background-image:none;font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\" title=\"Scripting language\" href=\"http://en.wikipedia.org/wiki/Scripting_language\">scripting language</a><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">Â standardized byÂ </span><a style=\"color:#0b0080;background-image:none;font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\" title=\"Ecma International\" href=\"http://en.wikipedia.org/wiki/Ecma_International\">Ecma International</a><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">Â in theÂ </span><strong style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">ECMA-262</strong><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">Â </span><a style=\"color:#0b0080;background-image:none;font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\" title=\"Specification (technical standard)\" href=\"http://en.wikipedia.org/wiki/Specification_(technical_standard)\">specification</a><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">Â and ISO/IEC 16262. The language is widely used forÂ </span><a style=\"color:#0b0080;background-image:none;font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\" title=\"Client-side scripting\" href=\"http://en.wikipedia.org/wiki/Client-side_scripting\">client-side scripting</a><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">Â on theÂ </span><a style=\"color:#0b0080;background-image:none;font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\" title=\"World Wide Web\" href=\"http://en.wikipedia.org/wiki/World_Wide_Web\">web</a><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">, in the form of several well-known dialects such asÂ </span><a style=\"color:#0b0080;background-image:none;font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\" title=\"JavaScript\" href=\"http://en.wikipedia.org/wiki/JavaScript\">JavaScript</a><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">,Â </span><a style=\"color:#0b0080;background-image:none;font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\" title=\"JScript\" href=\"http://en.wikipedia.org/wiki/JScript\">JScript</a><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">andÂ </span><a style=\"color:#0b0080;background-image:none;font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\" title=\"ActionScript\" href=\"http://en.wikipedia.org/wiki/ActionScript\">ActionScript</a><span style=\"font-family:sans-serif;font-size:12.727272033691406px;line-height:19.190340042114258px;\">.</span></p>\r\n<h2 style=\"background-image:none;font-weight:normal;margin:0px 0px .6em;padding-top:.5em;padding-bottom:.17em;border-bottom-width:1px;border-bottom-style:solid;border-bottom-color:#aaaaaa;font-size:19.09090805053711px;font-family:sans-serif;line-height:19.190340042114258px;\"><span class=\"mw-headline\">History</span></h2>\r\n<p style=\"margin:.4em 0px .5em;line-height:19.190340042114258px;font-family:sans-serif;font-size:12.727272033691406px;\"><a style=\"color:#0b0080;background-image:none;\" title=\"JavaScript\" href=\"http://en.wikipedia.org/wiki/JavaScript\">JavaScript</a>Â was originally developed byÂ <a style=\"color:#0b0080;background-image:none;\" title=\"Brendan Eich\" href=\"http://en.wikipedia.org/wiki/Brendan_Eich\">Brendan Eich</a>Â ofÂ <a class=\"mw-redirect\" style=\"color:#0b0080;background-image:none;\" title=\"Netscape Communications Corporation\" href=\"http://en.wikipedia.org/wiki/Netscape_Communications_Corporation\">Netscape</a>Â under the name Mocha, later LiveScript, and finally renamed to JavaScript.<sup class=\"reference\" style=\"line-height:1em;\"><a style=\"color:#0b0080;background-image:none;white-space:nowrap;\" href=\"http://en.wikipedia.org/wiki/ECMAScript#cite_note-2\">[2]</a></sup>Â In December 1995,Â <a style=\"color:#0b0080;background-image:none;\" title=\"Sun Microsystems\" href=\"http://en.wikipedia.org/wiki/Sun_Microsystems\">Sun Microsystems</a>Â and Netscape announced JavaScript in a press release.<sup class=\"reference\" style=\"line-height:1em;\"><a style=\"color:#0b0080;background-image:none;white-space:nowrap;\" href=\"http://en.wikipedia.org/wiki/ECMAScript#cite_note-3\">[3]</a></sup>Â In March 1996,<a style=\"color:#0b0080;background-image:none;\" title=\"Netscape Navigator\" href=\"http://en.wikipedia.org/wiki/Netscape_Navigator\">Netscape Navigator</a>Â 2.0 was released, featuring support for JavaScript.</p>\r\n<p style=\"margin:.4em 0px .5em;line-height:19.190340042114258px;font-family:sans-serif;font-size:12.727272033691406px;\">Due to the widespread success of JavaScript as a client-side scripting language for web pages,Â <a style=\"color:#0b0080;background-image:none;\" title=\"Microsoft\" href=\"http://en.wikipedia.org/wiki/Microsoft\">Microsoft</a>Â developed a compatible dialect of the language, naming itÂ <a style=\"color:#0b0080;background-image:none;\" title=\"JScript\" href=\"http://en.wikipedia.org/wiki/JScript\">JScript</a>Â to avoid trademark issues. JScript added new date methods to fix the non-<a style=\"color:#0b0080;background-image:none;\" title=\"Year 2000 problem\" href=\"http://en.wikipedia.org/wiki/Year_2000_problem\">Y2K</a>-friendly methods in JavaScript, which were based on the JavaÂ <em>Date</em>Â class.<sup class=\"reference\" style=\"line-height:1em;\"><a style=\"color:#0b0080;background-image:none;white-space:nowrap;\" href=\"http://en.wikipedia.org/wiki/ECMAScript#cite_note-4\">[4]</a></sup>Â JScript was included inÂ <a style=\"color:#0b0080;background-image:none;\" title=\"Internet Explorer\" href=\"http://en.wikipedia.org/wiki/Internet_Explorer\">Internet Explorer</a>Â 3.0, released in August 1996.</p>\r\n<p style=\"margin:.4em 0px .5em;line-height:19.190340042114258px;font-family:sans-serif;font-size:12.727272033691406px;\">Netscape delivered JavaScript toÂ <a style=\"color:#0b0080;background-image:none;\" title=\"Ecma International\" href=\"http://en.wikipedia.org/wiki/Ecma_International\">Ecma International</a>Â for standardization and the work on the specification, ECMA-262, began in November 1996.<sup class=\"reference\" style=\"line-height:1em;\"><a style=\"color:#0b0080;background-image:none;white-space:nowrap;\" href=\"http://en.wikipedia.org/wiki/ECMAScript#cite_note-5\">[5]</a></sup>Â The first edition of ECMA-262 was adopted by the Ecma General Assembly of June 1997. Several editions of the language standard have been published since then.</p>\r\n<p style=\"margin:.4em 0px .5em;line-height:19.190340042114258px;font-family:sans-serif;font-size:12.727272033691406px;\">ECMAScript is the name of the scripting language standardized in ECMA-262. The name \"ECMAScript\" was a compromise between the organizations involved in standardizing the language, especially Netscape and Microsoft, whose disputes dominated the early standards sessions. Brendan Eich, the creator of JavaScript, commented that \"ECMAScript was always an unwanted trade name that sounds like a skin disease.\"<sup class=\"reference\" style=\"line-height:1em;\"><a style=\"color:#0b0080;background-image:none;white-space:nowrap;\" href=\"http://en.wikipedia.org/wiki/ECMAScript#cite_note-6\">[6]</a></sup></p>\r\n<p style=\"margin:.4em 0px .5em;line-height:19.190340042114258px;font-family:sans-serif;font-size:12.727272033691406px;\">While both JavaScript and JScript aim to be compatible with ECMAScript, they also provide additional features not described in the ECMA specifications.<sup class=\"Template-Fact\" style=\"line-height:1em;white-space:nowrap;\">[<em><a style=\"color:#0b0080;background-image:none;\" title=\"Wikipedia:Citation needed\" href=\"http://en.wikipedia.org/wiki/Wikipedia:Citation_needed\"><span title=\"This claim needs references to reliable sources from July 2012\">citation needed</span></a></em>]</sup></p>','JS','egisolehhasdi','2013-02-10 21:55:14','egisolehhasdi','2013-02-20 09:48:46',NULL,NULL,45,'jvthaashaar,fathmalik15,egisolehhasdi,yudith','publish'),(10,'ad','<p>as</p>','','fathmalik15','2013-02-16 14:40:52',NULL,NULL,NULL,NULL,3,NULL,'archived'),(11,'yu','<p>as</p>','PHP,Codeigniter','fathmalik15','2013-02-16 14:41:09',NULL,NULL,NULL,NULL,1,NULL,'archived'),(12,'erer','<p>fdas</p>','','fathmalik15','2013-02-16 14:41:40',NULL,NULL,NULL,NULL,0,NULL,'archived'),(13,'adfg','<p>asdfsafasfsaf</p>','','fathmalik15','2013-02-16 14:42:42',NULL,NULL,NULL,NULL,4,'egisolehhasdi','archived'),(14,'Beberapa Jurusan dengan Bayaran Tertinggi #1','<p>Buat kalian yang mau nerusin kuliah setelah lulus dari SMK, penulis mau ngasih tau nih beberapa jurusan yang gajinya nanti dibilang terjamin lah yaaa.. (mau kuliah ujung-ujungnya kerja juga kan yah? )</p>\n<p>sebelumnya kalau udah punya pilihan jurusan yang disukai jangan jadi terpengaruh sama artikel ini, karena sebenarnya dibalik gaji besar ada yang lebih penting, yaitu kalian <em>enjoy</em> dengan pilihan jurusan ataupun kerja dengan minat :)</p>\n<p><em>for your information</em>, kalau kita <em>enjoyÂ </em>sama suatu pilihan, nantinya pilihan itu yang akan menuntun kalian semua sama harta dan tahta. <em>So</em>, jangan sampai salah jurusan karena ngeliat artikel tentang jurusan dengan gaji besar :)</p>\n<p>Okay, pertama jurusan yang rada bakal bikin tebel dompet nantinya ya jurusan yang lagi kita tekunin di SMK 4 ini, yaitu Tekhnologi Informatika (ada yang bilang Ilmu Komputer juga, tapi beda yaa sama Sistem Informasi) tapi yang berhubungan sama TI itu terjaminlah asal kalian doyan yaaaaaahhh....</p>\n<blockquote>\n<p>kalau mau tau bedanya Ilmu Komputer sama Sistem Informasi bisa rada di datengin nih web nya anak TI kampus UI: http://www.cs.ui.ac.id/lang/en/pendidikan/penerimaan/perbedaan-ilmu-komputer-dan-sistem-informasi/?lang=en</p>\n</blockquote>\n<p>lanjut lagi besok kali ya buat jurusan yang lain.Â <em>so,Â </em>pantengin terus deh artikel-artikelnya..</p>','Kuliah,Kerja','jvthaashaar','2013-02-22 14:02:05','jvthaashaar','2013-02-27 23:36:40',NULL,NULL,23,'egisolehhasdi','publish'),(15,'Beberapa Jurusan dengan Bayaran Tertinggi #2','<p>Nah lanjutin yang kemarin di http://ti.smkn4bdg.sch.id/article/view/id/14 tentang jurusan dengan bayaran tertinggi...</p>\n<p>Jurusan yang ga kalah bikin kayanya adalah... Yapp segala macam jurusan tentang kebumian.. yaitu Geologi sama Teknik Tambang. Wow kayanya macho banget dengan jurusan yang beginian :) Tapi tetep tuh harus sesuai minat dan bakat ya ga??Â </p>','Kuliah','jvthaashaar','2013-02-27 23:35:37',NULL,NULL,NULL,NULL,4,'egisolehhasdi','publish');
