INSERT INTO `news` VALUES (8,'Hahahaha','<p style=\"text-align:center;\"><strong><em><span style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\">KISAH UANG Rp 1.000 DAN Rp 100.000</span></em></strong><br style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\" /><br style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\" /><em><span style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\">Uang Rp 1.000 dan Rp 100.000 sama-sama terbuat dari kertas, sama-sama dicetak dan diedarkan oleh Bank Indonesia (BI).</span></em><br style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\" /><br style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\" /><em><span style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\">Ketika bersamaan mereka keluar dan berpisah dari Bank dan beredar di masyarakat, 4 bulan kemudian mereka bertemu lagi secara tidak sengaja di dalam dompet seorang pemuda.</span></em><br style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\" /><em><span class=\"text_exposed_show\" style=\"color:#333333;font-family:\'lucida grande\', tahoma, verdana, arial, sans-serif;font-size:13px;line-height:17px;\"><br />Kemudian diantara kedua uang tersebut terjadilah percakapan; Yang Rp 100. 000 bertanya kepada Rp 1.000, â€˜Kenapa badan kamu begitu lusuk, kotor dan bau amis? Rp 1.000 menjawab, â€˜Karena aku begitu keluar dari Bank langsung ditangan orang-orang bawahan dari tukang becak, tukang sayur, penjual ikan dan ditangan pengemis.â€™<br /><br />Lalu Rp 1.000 bertanya balik kepada Rp 100.000, â€˜Kenapa kamu kelihatan begitu baru, rapi dan masih bersih?â€™<br /><br />Dijawabnya, â€˜Karena begitu aku keluar dari Bank, langsung disambut perempuan cantik, dan beredarnya pun di restoran mahal, di mall dan juga hotel-hotel berbintang serta keberadaanku selalu dijaga dan jarang keluar dari dompet.â€™ Lalu Rp 1.000 bertanya lagi, â€˜Pernahkah engkau mampir di tempat ibadah?â€™<br />Dijawablah, â€˜Belum pernahâ€™<br /><br />Rp 1.000 pun berkata lagi, â€˜Ketahuilah walaupun aku hanya Rp 1.000, tetapi aku selalu mampir di seluruh tempat ibadah, dan ditangan anak-anak yatim piatu dan fakir miskin bahkan aku selalu bersyukur kepada Tuhan. Aku tidak dipandang bukan sebuah nilai, tetapi adalah sebuah manfaat.â€™<br /><br />Akhirnya menangislah Rp 100.000 karena merasa besar, hebat, tinggi tetapi tidak begitu bermanfaat selama ini. Jadi bukan seberapa besar penghasilan kita, tetapi seberapa bermanfaat penghasilan kita pakai untuk ke jalan yang benar.<br /><br />KARENA KEKAYAAN BUKANLAH UNTUK KESOMBONGAN..</span></em></p>','fathmalik15','2013-02-18 22:17:29',NULL,NULL,NULL,NULL,0,'publish'),(10,'Hanoman','<p style=\"color:#333333;font-family:arial;line-height:20px;\"><strong>DENPASAR, KOMPAS.comÂ </strong>-- Seniman berprestasi, khususnya seniman senior yang karyanya telah diakui masyarakat Bali akan mendapat kado spesial di setiap ulang tahun Provinsi Bali pada tanggal 14 Agustus. Pemerintah Provinsi Bali bersama DPRD Bali kini tengah menggodok dan memperbaiki peraturan daerah yang mengaturÂ <em>rewardÂ </em>bagi seniman.</p>\r\n<p style=\"color:#333333;font-family:arial;line-height:20px;\">\"Penghargaan seni itu yang kita sebut Dharma Kusuma. Kita berikan kepada seniman yang beprestasi, waktu mengabdikan diri, dan karyanya bisa diuji oleh publik,\" ujar Kepala Dinas Kebudayaan Bali, Ketut Suastika saat ditemui di kantor DPRD Bali, Senin (18/02/2013).</p>\r\n<p style=\"color:#333333;font-family:arial;line-height:20px;\">Bentuk penghargaan yang diberikan Pemprov Bali, kata Ketut, berupa medali emas seberat 20 gram. Pemprov Bali akan memilih 9 seniman yang memenuhi syarat penerima penghargaan Dharma Kusuma dari 9 Kabupaten/Kota di Bali.</p>\r\n<p style=\"color:#333333;font-family:arial;line-height:20px;\">Selain emas seberat 20 gram, Pemprov Bali juga akan memberikan uang tunai masing-masing Rp 10 juta kepada seniman berprestasi. Penghargaan ini sebenarnya telah diberikan sejak tahun 1984 lalu, namun kadar emas yang tepat baru akan diatur dalam perda terbaru yang sedang dirancang.</p>\r\n<p style=\"color:#333333;font-family:arial;line-height:20px;\">Rencananya, tahun ini Pemprov Bali akan memberikan salah satu penghargaan tersebut kepada Dolar, seniman senior Bali yang kini sedang sakit dan menjalani perawatan di rumah sakit.</p>\r\n<div class=\"clearit\" style=\"clear:both;margin:0px;padding:0px;color:#333333;font-family:arial;line-height:20px;\">Â </div>\r\n<div class=\"left\" style=\"float:left;color:#333333;font-family:arial;line-height:20px;\">Â </div>\r\n<div class=\"clearit\" style=\"clear:both;margin:0px;padding:0px;color:#333333;font-family:arial;line-height:20px;\">Â </div>\r\n<div class=\"left\" style=\"float:left;color:#333333;font-family:arial;line-height:20px;\">\r\n<div class=\"left pr_5 pt_5 font11 c_abu\" style=\"float:left;color:#808080;font-size:11px;padding-right:5px;padding-top:5px;\"><strong>Editor :</strong></div>\r\n<div class=\"left pt_5 c_abu01_kompas2011 font13\" style=\"font-size:13px;float:left;padding-top:5px;\">Farid Assifa</div>\r\n<p>Â </p>\r\n</div>','fathmalik15','2013-02-18 22:19:29',NULL,NULL,NULL,NULL,0,'publish'),(11,'Yuk Berbagi Motivasi kepada Anak-anak Jalanan!','<div class=\"multi_foto_wide\" style=\"width: 654px; font-size: 12px; font-family: Arial, Helvetica, sans-serif; color: #818181;\">\r\n<div id=\"foto1\"><img style=\"width: 654px; height: 327px;\" src=\"http://assets.kompas.com/data/photo/2013/02/18/1647398-kampanye-karya-anak-indonesia-sahabat-anak-620X310.jpg\" alt=\"\" width=\"630\" /><span class=\"pb_10\" style=\"padding-bottom: 10px; display: block; text-align: right; font-size: 10px; color: #999999;\">dok. Sahabat Anak</span>Kampanye Karya Anak Indonesia (KADO).</div>\r\n</div>\r\n<div class=\"isi_berita2011 pt_5\" style=\"font-family: arial; color: #333333; line-height: 20px; padding-top: 5px;\">\r\n<p><strong>JAKARTA, KOMPAS.com -&nbsp;</strong>Sekitar 55 persen anak-anak jalanan ternyata menyimpan mimpi untuk pekerjaan dan masa depan yang lebih baik serta pengembangan karakter yang positif. Mereka ingin perubahan dan mereka butuh kesempatan untuk mengubah hidup mereka.<br /><br />Butuh orang yang mau berbagi kepada mereka bahwa cita-cita dan mimpi harus diperjuangkan. Butuh orang yang mau menginspirasi mereka bahwa perlu kerja keras, kreativitas dan inovasi untuk mewujudkan mimpi.<br /><br />Komunitas pemerhati kesejahteraan anak, Sahabat Anak, mengajak masyarakat umum untuk turut serta mendukung cita-cita anak-anak jalanan tersebut melalui kampanye Karya Anak Indonesia (KADO). Siapa pun bisa membantu anak-anak jalanan untuk mewujudkan karya dan impian mereka hanya dengan menyediakan waktu untuk menjadi relawan pendamping.<br /><br />Syaratnya, calon relawan harus berusia minimal 19 tahun pada tahun ini. Calon relawan juga harus memiliki minat terhadap pelayanan anak dan bersedia menandatangan Komitmen Perlindungan Anak serta bersedia menghadiri pelatihan pendamping penuh waktu paling tidak satu kali dan acara KADO yang akan digelar tanggal 28 April mendatang.<br /><br />Calon relawan diminta untuk mengisi kuesioner dalam formulir pendaftaran yang bisa diunduh di&nbsp;<a style=\"color: #1170a0; text-decoration: initial;\" href=\"http://www.facebook.com/l.php?u=http%3A%2F%2Fwww.sahabatanak.org%2Fattachments%2Farticle%2F236%2FForm%2520Pendamping%2520KADO2013.doc&amp;h=HAQEyS42Q&amp;s=1\">laman berikut ini</a>. Lalu kirim formulir aplikasi ke email volunteer@sahabatanak.com.<br /><strong><br />Berbagi motivasi</strong><br /><br />Kampanye KADO muncul setelah Sahabat Anak melakukan survei \"Kapsul Impian\" kepada 1.000 anak jalanan pada tahun 2012. Survei menunjukkan 55 persen anak jalanan memimpikan pekerjaan dan masa depan yang lebih cerah.<br /><br />Tahun ini, kampanye KADO akan mengangkat tema \"Aku Berharga, Aku Berkarya\". Sejak awal pula, kampanye ini memang mengharapkan sebanyak mungkin partisipasi dari masyarakat untuk mendorong aspirasi pengembangan diri anak-anak jalanan di wilayah Jabodetabek.<br /><br />\"Motivasi dan semangat merupakan kata kunci bagi anak-anak kaum marjinal dalam meraih pekerjaan dan kesempatan yang mereka impikan. Sahabat Anak mengajak pihak yang peduli untuk ambil bagian menjadi agen perubahan yang senantiasa memberi motivasi dan semangat bagi adik-adik kami,\" kata Ketua Panitia KADO, Rama Adi Putra, dalam rilis yang diterima&nbsp;<em>Kompas.com</em>.<br /><br />Kampanye KADO akan terbagi dalam dua tahap, yaitu Proyek Impian \"Aku dan Sekitarku\" yang diikuti oleh 500 anak jalanan dan 250 sukarelawan serta Jambore Sahabat Anak yang diikuti oleh seribu anak dengan 500 sukarelawan pendamping.&nbsp;<br /><br />Dalam proyek Impian \"Aku dan Sekitarku\", anak-anak jalanan berusia 10-15 tahun di Jabodetabek akan dikumpulkan dalam kelompok-kelompok tertentu bersama lima relawan pendamping. Kelompok-kelompok ini akan diberi waktu dua bulan untuk menghasilkan suatu karya berupa produk, aksi atau pameran yang memiliki manfaat bagi lingkungan.<br /><br />Setiap kelompok akan dibekali modal awal sebesar Rp 50.000 dan diperbolehkan untuk mencari sponsor dalam mengelola proyek mereka dengan memanfaatkan jejaring sosial yang ada berdasarkan kerangka waktu, anggaran dan rencana kerja. Kegiatan ini diharapkan bisa mengajarkan kepada anak-anak untuk menghargai proses.</p>\r\n<p>&nbsp;</p>\r\n<div class=\"clearit pt_30\" style=\"clear: both; margin: 0px; padding: 30px 0px 0px;\">&nbsp;</div>\r\n<div class=\"clearit\" style=\"clear: both; margin: 0px; padding: 0px;\">&nbsp;</div>\r\n<div class=\"left\" style=\"float: left;\">&nbsp;</div>\r\n<div class=\"clearit\" style=\"clear: both; margin: 0px; padding: 0px;\">&nbsp;</div>\r\n<div class=\"left\" style=\"float: left;\">\r\n<div class=\"left pr_5 pt_5 font11 c_abu\" style=\"float: left; color: #808080; font-size: 11px; padding-right: 5px; padding-top: 5px;\"><strong>Editor :</strong></div>\r\n<div class=\"left pt_5 c_abu01_kompas2011 font13\" style=\"font-size: 13px; float: left; padding-top: 5px;\">Caroline Damanik</div>\r\n<p>&nbsp;</p>\r\n</div>\r\n</div>','egisolehhasdi','2013-02-18 22:19:54',NULL,NULL,NULL,NULL,0,'publish'),(12,'buakakak','<p style=\"color:#333333;font-family:arial;line-height:20px;\"><strong>DENPASAR, KOMPAS.comÂ </strong>-- Seniman berprestasi, khususnya seniman senior yang karyanya telah diakui masyarakat Bali akan mendapat kado spesial di setiap ulang tahun Provinsi Bali pada tanggal 14 Agustus. Pemerintah Provinsi Bali bersama DPRD Bali kini tengah menggodok dan memperbaiki peraturan daerah yang mengaturÂ <em>rewardÂ </em>bagi seniman.</p>\r\n<p style=\"color:#333333;font-family:arial;line-height:20px;\">\"Penghargaan seni itu yang kita sebut Dharma Kusuma. Kita berikan kepada seniman yang beprestasi, waktu mengabdikan diri, dan karyanya bisa diuji oleh publik,\" ujar Kepala Dinas Kebudayaan Bali, Ketut Suastika saat ditemui di kantor DPRD Bali, Senin (18/02/2013).</p>\r\n<p style=\"color:#333333;font-family:arial;line-height:20px;\">Bentuk penghargaan yang diberikan Pemprov Bali, kata Ketut, berupa medali emas seberat 20 gram. Pemprov Bali akan memilih 9 seniman yang memenuhi syarat penerima penghargaan Dharma Kusuma dari 9 Kabupaten/Kota di Bali.</p>\r\n<p style=\"color:#333333;font-family:arial;line-height:20px;\">Selain emas seberat 20 gram, Pemprov Bali juga akan memberikan uang tunai masing-masing Rp 10 juta kepada seniman berprestasi. Penghargaan ini sebenarnya telah diberikan sejak tahun 1984 lalu, namun kadar emas yang tepat baru akan diatur dalam perda terbaru yang sedang dirancang.</p>\r\n<p style=\"color:#333333;font-family:arial;line-height:20px;\">Rencananya, tahun ini Pemprov Bali akan memberikan salah satu penghargaan tersebut kepada Dolar, seniman senior Bali yang kini sedang sakit dan menjalani perawatan di rumah sakit.</p>\r\n<div class=\"clearit\" style=\"clear:both;margin:0px;padding:0px;color:#333333;font-family:arial;line-height:20px;\">Â </div>\r\n<div class=\"left\" style=\"float:left;color:#333333;font-family:arial;line-height:20px;\">Â </div>\r\n<div class=\"clearit\" style=\"clear:both;margin:0px;padding:0px;color:#333333;font-family:arial;line-height:20px;\">Â </div>\r\n<div class=\"left\" style=\"float:left;color:#333333;font-family:arial;line-height:20px;\">\r\n<div class=\"left pr_5 pt_5 font11 c_abu\" style=\"float:left;color:#808080;font-size:11px;padding-right:5px;padding-top:5px;\"><strong>Editor :</strong></div>\r\n<div class=\"left pt_5 c_abu01_kompas2011 font13\" style=\"font-size:13px;float:left;padding-top:5px;\">Farid Assifa</div>\r\n<p>Â </p>\r\n</div>','fathmalik15','2013-02-18 22:23:31',NULL,NULL,NULL,NULL,0,'publish'),(13,'SMK SNMPTN 2013??','<p>Berita kali ini mau ngasih tau nih tentang kampus yang tidak menerima siswa/i SMK melalui jalur SNMPTN 2013 :)</p>\r\n<p>yaitu,Â Kampus ITB (Semua jurusan kecuali FSRD)...</p>\r\n<p>tetep semangat yah masih ada kesempatan kok buat masuk kampus tersebut melalui SBMPTN 2013 :)</p>','jvthaashaar','2013-02-22 22:05:46',NULL,NULL,NULL,NULL,0,'publish');
